description:
Exploits Of Danoel Boone - greatest American frontier hero.

We pay tribute to the sturdy pioneers who built our nation and defended it with their lives - men such as Jim Bowie, Kit Carson, Can Morgan, Davy Crockett, George Rogers Clark, Lew Wetzel and Zebulon Pike...but the one who stands head and shoulders above the rest is - DANIEL BOONE. His daring deeds overshadow by far those of any frontier fighter.

Published by Quality Comics.


